export async function register(email, password) {
    const requestBody = {
        email: email, 
        password: password
    }
    const response = await fetch('http://localhost:5000/register', {
        method: 'POST', 
        headers: {
            'Content-Type': 'application/json'
        },
        body: JSON.stringify(requestBody)
    });
    const data = await response.json();
    return data;
}
